import React , {useState} from 'react'
import Select from 'react-select'

function FileName(){
  var countryList =[
    {
    value :1,
    label : 'Japan'
    },
    {
    value :2,
    label : 'China'
    },
    {
    value :2,
    label : 'Korea'
    },
    {
    value :3,
    label : 'Canada'
    }
    ];    
const [result,value]=useState(countryList.label);
const Handler = e =>(value(e.label))
return(
<div>
<Select options = {countryList} onChange={Handler}/>
<h1>{result}</h1>
</div>
);
}

export default FileName;
